    handleBack() {
      const entryRoute = localStorage.entry_route;
      if (
        this.$route.name === "FailedView" ||
        this.$route.name === "SuccessView" ||
        this.$route.name === "ChoosePaymentCheckout" ||
        this.$route.name === "Entry" ||
        this.$route.params.entry ||
        (this.$route.name === "AddPayment" && this.$route.params.entry)
      ) {
        this.$router.push(entryRoute);
        return;
      }
      this.$router.go(-1);
    },
  },
};
